import React, { useState } from "react";

export default function DropdownMapFilter() {
  const [indiaval, setindia] = useState(["Mumbai", "Delhi", "Pune"]);
  const [americaval, setamerica] = useState([
    "Sanfranciso",
    "Denvar",
    "california",
  ]);
  const [info, setinfo] = useState("");

  const data = ["India", "America", "England", "Newzeland", "Australia"];
  return (
    <div>
      <select value={info} onChange={(e) => setinfo(e.target.value)}>
        {data.map((result) => (
          <option>{result}</option>
        ))}
      </select>
      <div>
        <select name="selcountry">
            {data.fi}
        </select>
      </div>
    </div>
  );
}
